import React from "react";
import Header from "../components/NavSignIn";
import FooterDiv from "../components/Footer";
import NoteDiv from "../components/NoteDiv";

function Notes() {
    return (
        <div>
        <Header />
        <NoteDiv />
        <NoteForm />
        <br></br>
        <br></br>
        <FooterDiv/>
        </div>
    )
}

export default Notes;
